// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ShippingContract {
    enum ShipmentStatus { Created, InTransit, Delivered, Cancelled }

    struct Shipment {
        address seller;
        address buyer;
        address courier;
        uint256 creationTime;
        uint256 deliveryPrice;
        ShipmentStatus status;
        bool exists;
    }

    mapping(uint256 => Shipment) public shipments;
    uint256 private shipmentCounter;

    event ShipmentCreated(uint256 indexed shipmentId, address indexed seller, address buyer);
    event StatusUpdated(uint256 indexed shipmentId, ShipmentStatus status);
    event DeliveryConfirmed(uint256 indexed shipmentId);
    event ShipmentCancelled(uint256 indexed shipmentId);

    modifier onlyParticipant(uint256 shipmentId) {
        require(
            msg.sender == shipments[shipmentId].seller ||
            msg.sender == shipments[shipmentId].buyer ||
            msg.sender == shipments[shipmentId].courier,
            "Not a participant"
        );
        _;
    }

    function createShipment(
        address _buyer,
        address _courier,
        uint256 _deliveryPrice
    ) external payable {
        require(msg.value == _deliveryPrice, "Incorrect payment amount");
        
        shipmentCounter++;
        shipments[shipmentCounter] = Shipment({
            seller: msg.sender,
            buyer: _buyer,
            courier: _courier,
            creationTime: block.timestamp,
            deliveryPrice: _deliveryPrice,
            status: ShipmentStatus.Created,
            exists: true
        });

        emit ShipmentCreated(shipmentCounter, msg.sender, _buyer);
    }

    function updateStatus(uint256 shipmentId, ShipmentStatus _status) external {
        require(shipments[shipmentId].exists, "Shipment does not exist");
        require(msg.sender == shipments[shipmentId].courier, "Only courier can update status");
        
        shipments[shipmentId].status = _status;
        emit StatusUpdated(shipmentId, _status);

        if (_status == ShipmentStatus.Delivered) {
            payable(shipments[shipmentId].courier).transfer(shipments[shipmentId].deliveryPrice);
        }
    }

    function confirmDelivery(uint256 shipmentId) external {
        require(shipments[shipmentId].exists, "Shipment does not exist");
        require(msg.sender == shipments[shipmentId].buyer, "Only buyer can confirm delivery");
        require(shipments[shipmentId].status == ShipmentStatus.Delivered, "Shipment not delivered");

        emit DeliveryConfirmed(shipmentId);
        // Add any additional logic for delivery confirmation
    }

    function cancelShipment(uint256 shipmentId) external onlyParticipant(shipmentId) {
        require(shipments[shipmentId].status == ShipmentStatus.Created, "Cannot cancel shipment");
        
        shipments[shipmentId].status = ShipmentStatus.Cancelled;
        payable(shipments[shipmentId].buyer).transfer(shipments[shipmentId].deliveryPrice);
        
        emit ShipmentCancelled(shipmentId);
    }

    function getShipment(uint256 shipmentId) external view returns (Shipment memory) {
        require(shipments[shipmentId].exists, "Shipment does not exist");
        return shipments[shipmentId];
    }
}

